var script_f42_0_43020=[""].join("\n");
var outline_f42_0_43020=null;
var title_f42_0_43021="Rx VRE endocarditisII";
var content_f42_0_43021=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F66444&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F66444&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested regimens for therapy of native or prosthetic valve endocarditis due to enterococcal strains resistant to penicillin, aminoglycoside, and vancomycin*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"       American Heart Association",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"       British Society for Antimicrobial Chemotherapy",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"       European Society of Cardiology",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2\">",
"       Adult (for patients with normal renal function)",
"      </td>",
"      <td class=\"subtitle2\" colspan=\"1\">",
"       Pediatric (not to exceed dose of normal adult)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <p>",
"        <strong>",
"         E. faecium:",
"        </strong>",
"       </p>",
"       <p>",
"        <strong>",
"         One of the following:",
"        </strong>",
"       </p>",
"       <p>",
"        Linezolid&bull; 1200 mg per 24 h IV or PO in 2 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Quinupristin-dalfopristin&Delta; 22.5 mg/kg per 24 h IV in 3 equally divided doses for &ge;8 wks",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        <strong>",
"         E. faecium:",
"        </strong>",
"       </p>",
"       <p>",
"        <strong>",
"         One of the following:",
"        </strong>",
"       </p>",
"       <p>",
"        Linezolid&bull; 30 mg/kg per 24 h IV or PO in 3 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Quinupristin-dalfopristin&Delta; 22.5 mg/kg per 24 h IV in 3 equally divided doses for &ge;8 wks",
"       </p>",
"      </td>",
"      <td rowspan=\"2\">",
"       <p>",
"        <strong>",
"         One of the following:",
"        </strong>",
"       </p>",
"       <p>",
"        Linezolid&bull; 1200 mg per 24 h IV or PO in 2 equally divided doses for &ge;6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Quinupristin-dalfopristin&Delta; 22.5 mg/kg per 24 h IV in 3 equally divided doses for &ge;6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Teicoplanin&loz; 10 mg/kg IV once daily for &ge;6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Combinations of antibiotics according to in vitro susceptibility",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        <strong>",
"         E. faecium&yen;:",
"        </strong>",
"       </p>",
"       <p>",
"        Linezolid&bull; 1200 mg per 24 h IV or PO in 2 equally divided doses for &ge; 8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Quinupristin-dalfopristin&Delta; 22.5 mg/kg per 24 h IV in 3 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Combinations of antibiotics according to in vitro susceptibility&Dagger;",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <p>",
"        <strong>",
"         E. faecalis&sect;:",
"        </strong>",
"       </p>",
"       <p>",
"        Imipenem-cilastatin 2 g per 24 h IV in 4 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 12 g per 24 h IV in 6 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Ceftriaxone 4 g per 24 h IV or IM in 2 equally divided doses for &ge;8 wks&dagger;",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 12 g per 24 h IV in 6 equally divided doses for &ge;8 wks",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        <strong>",
"         E. faecalis&sect;:",
"        </strong>",
"       </p>",
"       <p>",
"        Imipenem-cilastatin 60-100 mg/kg per 24 h IV in 4 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 300 mg/kg per 24 h IV in 4 to 6 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Ceftriaxone 100 mg/kg per 24 h IV or IM in 2 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 300 mg/kg per 24 h IV in 4 to 6 equally divided doses for &ge;8 wks",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        <strong>",
"         E. faecalis&sect;:",
"        </strong>",
"       </p>",
"       <p>",
"        Imipenem-cilastatin 2 g per 24 h (or 60-100 mg/kg per 24 h) IV in 4 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 12 g per 24 h (or 300 mg/kg per 24 h) IV in 6 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Ceftriaxone 2 g per 24 h (or 100 mg/kg per 24 h) IV or IM in 1 dose for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 12 g per 24 h (or 300 mg/kg per 24 h) IV in 6 equally divided doses for &ge;8 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Combinations of antibiotics according to in vitro susceptibility&Dagger;",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IV: intravenously; IM: intramuscularly; PO: orally; h: hours; wks: weeks.",
"     <br>",
"      * Decreasing order of preference based on published data. Patients with endocarditis caused by these strains should be treated in consultation with an infectious disease specialist; cardiac valve replacement may be necessary for bacteriologic cure; cure with antimicrobial therapy alone may be &lt;50 percent.",
"      <br>",
"       &bull; Severe, usually reversible thrombocytopenia may occur with use of linezolid, especially after 2 wks of therapy. Monitor hematologic toxicity.",
"       <br>",
"        &Delta; Only effective against E. faecium and can cause severe myalgias, which may require discontinuation of therapy.",
"        <br>",
"         &loz; Provided isolate is teicoplanin susceptible (MIC &le;4 mg/L). Strains highly resistant to vancomycin (vanA type resistance) are also resistant to teicoplanin.",
"         <br>",
"          &sect; Only a small number of patients have been treated with imipenem-cilastatin plus ampicillin or ceftriaxone plus ampicillin.",
"          <br>",
"           &yen; Varying results reported with linezolid, quinupristin-dalfopristin, daptomycin and tigecycline.",
"           <br>",
"            &Dagger; High level E. faecalis and E. faecium resistance to gentamicin (MIC&gt;500 mcg/mL): if susceptible to streptomycin, beta-lactam or vancomycin combination with streptomycin 15 mg/kg per 24 h IV in 2 equally divided doses, is an alternative.",
"            <br>",
"             &dagger; Although an every-24-hour dosing of ceftriaxone has never been formally studied in human trials in combination with ampicillin for the treatment of multidrug-resistant Enterococcus faecalis, unpublished animal model data indicate that every-12-hour dosing of ceftriaxone in combination with ampicillin is more efficacious in reducing the bacterial concentration in infected vegetations as compared with every-24-hour dosing of ceftriaxone with ampicillin.",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Circulation 2005; 111:3167; J Antimicrob Chemother 2004; 54:971; Eur Heart J 2009; 30:2369.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
